import {useEffect, useState} from "react";
import Toast from "../../../../components/toast-message/ToastMessage";
import Table from "../../../../components/custom-table/CustomTable";
import InventoryHistoryService from "../../../../services/warehouseServices/InventoryHistoryService";

export default function InventoryHistory() {
    const [inventoryHistory, setInventoryHistory] = useState([]);
    const [pagination, setPagination] = useState({
        page: 0,
        size: 10
    })

    const getInventoryHistoryList = async (page) => {
        try {
            const response = await InventoryHistoryService.getList(page);
            if (response.success) {
                setInventoryHistory(response.data);
            } else {
                Toast.error(response.message);
            }
        } catch (error) {
            Toast.error(error);
        }
    };

    const paginate = (page) => {
        setPagination({
            page: page,
            size: 10
        })
    }

    useEffect(() => {
        getInventoryHistoryList(pagination)
    }, [pagination])

    useEffect(() => {

    }, [inventoryHistory])

    return (
        <>
            <div className="card-header">
                Inventory history list
            </div>
            <div className="card-body">
                {inventoryHistory && (<Table data={inventoryHistory} isAction={true}/>)}
            </div>
        </>
    );
}
